        template: nanoaod-argo
        arguments:
          parameters: [{name: files, value: root://eospublic.cern.ch//eos/opendata/cms/MonteCarlo2012/Summer12_DR53X/W1JetsToLNu_TuneZ2Star_8TeV-madgraph/AODSIM/PU_S10_START53_V19-v1/10000/0015CDEA-C2E0-E211-836E-1CC1DE1D036C.root}, {name: it, value: 1}]
